import './Header.css'

const Header = () => {
  return (
    <div className='header'>
      <div className='header-bg'>
      <h3 className='title'>Weather App</h3>
      <input type="text" className='input'  />
      <button className='btn'>Search</button>

      </div>
      
      

    </div>
  );
}

export default Header;
